import React, { useEffect, useState } from 'react'
import Axios from "axios"
export const Historial = (props) => {
    const {rut} = props
    const [cargaHistorial, setcargaHistorial] = useState(0)
    const [historial, sethistorial] = useState("")
    useEffect(() => {
        Axios.get(`https://api-rest-cfedent.herokuapp.com/historiales-clinicos/${rut}`).then( (response) =>{
            if(response.status === 200){
                sethistorial(response.data[0])
            }   
        })
    }, [])
    return (
        <div className="container mt-3">
            {historial === undefined?
            <div className="alert alert-warning" role="alert">Paciente sin historial clinico</div>
            :
            console.log("crear historial")
            }
        </div>
    )
}
